import React from 'react';
import { Route, BrowserRouter, withRouter } from 'react-router-dom';
import NavBar from './NavBar.jsx';


class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {};
  }

  render(){
    return(
      <BrowserRouter>
        <div id="app-container">
          <>
            <NavBar/>
          </>
        </div>
      </BrowserRouter>
    )
  }
}

export default withRouter(App);
